import{_ as r,c as a,o,ae as n}from"./chunks/framework.BQlYxExx.js";const p=JSON.parse('{"title":"Doc 2: Recommended Learning Resources","description":"","frontmatter":{},"headers":[],"relativePath":"technical/LEARNING_RESOURCES.md","filePath":"technical/LEARNING_RESOURCES.md","lastUpdated":1764098389000}'),t={name:"technical/LEARNING_RESOURCES.md"};function i(l,e,s,c,d,u){return o(),a("div",null,[...e[0]||(e[0]=[n('<h1 id="doc-2-recommended-learning-resources" tabindex="-1">Doc 2: Recommended Learning Resources <a class="header-anchor" href="#doc-2-recommended-learning-resources" aria-label="Permalink to &quot;Doc 2: Recommended Learning Resources&quot;">​</a></h1><blockquote><p><strong>Executive Summary:</strong> This document provides a curated list of high-quality learning resources for our core technologies (TypeScript, Node.js, Prisma) and architectural concepts (Clean Architecture). It includes a recommended learning path for new developers to accelerate their onboarding and a link to our internal knowledge base. This guide is a key tool for fostering a culture of continuous learning and engineering excellence.</p><hr><p><strong>Last Reviewed:</strong> 2025-11-20 <strong>Document Owner:</strong> Engineering Lead</p></blockquote><hr><h2 id="english" tabindex="-1">English <a class="header-anchor" href="#english" aria-label="Permalink to &quot;English&quot;">​</a></h2><h3 id="_1-business-impact-analysis" tabindex="-1">1. Business Impact Analysis <a class="header-anchor" href="#_1-business-impact-analysis" aria-label="Permalink to &quot;1. Business Impact Analysis&quot;">​</a></h3><p>A well-defined learning path empowers our team, reduces dependency on senior engineers for basic questions, and ensures that best practices are adopted consistently across the organization.</p><ul><li><strong>Onboarding Speed:</strong> |########--| (8/10)</li><li><strong>Code Quality:</strong> |#######---| (7/10)</li><li><strong>Team Autonomy:</strong> |########--| (8/10)</li></ul><h3 id="_2-recommended-learning-path-for-new-developers" tabindex="-1">2. Recommended Learning Path for New Developers <a class="header-anchor" href="#_2-recommended-learning-path-for-new-developers" aria-label="Permalink to &quot;2. Recommended Learning Path for New Developers&quot;">​</a></h3><ol><li><strong>TypeScript:</strong> Start with the official handbook.</li><li><strong>Node.js &amp; Express:</strong> Follow the MDN guide.</li><li><strong>Prisma:</strong> Complete the &quot;Get Started&quot; guide.</li><li><strong>Architectural Concepts:</strong> Read the articles on Clean Architecture and Dependency Injection.</li></ol><h3 id="_3-core-technologies-concepts" tabindex="-1">3. Core Technologies &amp; Concepts <a class="header-anchor" href="#_3-core-technologies-concepts" aria-label="Permalink to &quot;3. Core Technologies &amp; Concepts&quot;">​</a></h3><ul><li><strong>Node.js &amp; Express:</strong><ul><li><a href="https://nodejs.org/en/docs/" target="_blank" rel="noreferrer">Official Node.js Docs</a></li><li><a href="https://developer.mozilla.org/en-US/docs/Learn/Server-side/Express_Nodejs" target="_blank" rel="noreferrer">MDN - Express/Node.js Introduction</a></li></ul></li><li><strong>TypeScript:</strong><ul><li><a href="https://www.typescriptlang.org/docs/handbook/intro.html" target="_blank" rel="noreferrer">TypeScript Handbook</a> (The single best place to start).</li></ul></li><li><strong>Prisma (ORM):</strong><ul><li><a href="https://www.prisma.io/docs" target="_blank" rel="noreferrer">Prisma Docs</a> (World-class documentation).</li></ul></li><li><strong>Architectural Concepts:</strong><ul><li><a href="https://blog.cleancoder.com/uncle-bob/2012/08/13/the-clean-architecture.html" target="_blank" rel="noreferrer">Clean Architecture by Robert C. Martin</a></li><li><a href="https://martinfowler.com/articles/injection.html" target="_blank" rel="noreferrer">Dependency Injection by Martin Fowler</a></li></ul></li></ul><h3 id="_4-internal-knowledge-base" tabindex="-1">4. Internal Knowledge Base <a class="header-anchor" href="#_4-internal-knowledge-base" aria-label="Permalink to &quot;4. Internal Knowledge Base&quot;">​</a></h3><ul><li><strong>AgroBridge Notion Wiki:</strong> <code>[Link to Company Notion/Confluence Page]</code></li><li><strong>Global Architecture Diagrams:</strong> <code>[Link to Company Miro/Lucidchart Board]</code></li></ul><hr><h2 id="espanol" tabindex="-1">Español <a class="header-anchor" href="#espanol" aria-label="Permalink to &quot;Español&quot;">​</a></h2><h3 id="_1-analisis-de-impacto-de-negocio" tabindex="-1">1. Análisis de Impacto de Negocio <a class="header-anchor" href="#_1-analisis-de-impacto-de-negocio" aria-label="Permalink to &quot;1. Análisis de Impacto de Negocio&quot;">​</a></h3><p>Una ruta de aprendizaje bien definida empodera a nuestro equipo, reduce la dependencia de los ingenieros senior para preguntas básicas y asegura que las mejores prácticas se adopten de manera consistente.</p><ul><li><strong>Velocidad de Onboarding:</strong> |########--| (8/10)</li><li><strong>Calidad del Código:</strong> |#######---| (7/10)</li><li><strong>Autonomía del Equipo:</strong> |########--| (8/10)</li></ul><h3 id="_2-ruta-de-aprendizaje-recomendada-para-nuevos-desarrolladores" tabindex="-1">2. Ruta de Aprendizaje Recomendada para Nuevos Desarrolladores <a class="header-anchor" href="#_2-ruta-de-aprendizaje-recomendada-para-nuevos-desarrolladores" aria-label="Permalink to &quot;2. Ruta de Aprendizaje Recomendada para Nuevos Desarrolladores&quot;">​</a></h3><ol><li><strong>TypeScript:</strong> Comience con el manual oficial.</li><li><strong>Node.js &amp; Express:</strong> Siga la guía de MDN.</li><li><strong>Prisma:</strong> Complete la guía &quot;Get Started&quot;.</li><li><strong>Conceptos de Arquitectura:</strong> Lea los artículos sobre Arquitectura Limpia e Inyección de Dependencias.</li></ol><h3 id="_3-tecnologias-y-conceptos-centrales" tabindex="-1">3. Tecnologías y Conceptos Centrales <a class="header-anchor" href="#_3-tecnologias-y-conceptos-centrales" aria-label="Permalink to &quot;3. Tecnologías y Conceptos Centrales&quot;">​</a></h3><ul><li><strong>Node.js &amp; Express:</strong><ul><li><a href="https://nodejs.org/en/docs/" target="_blank" rel="noreferrer">Documentación Oficial de Node.js</a></li><li><a href="https://developer.mozilla.org/en-US/docs/Learn/Server-side/Express_Nodejs" target="_blank" rel="noreferrer">Introducción a Express/Node.js de MDN</a></li></ul></li><li><strong>TypeScript:</strong><ul><li><a href="https://www.typescriptlang.org/docs/handbook/intro.html" target="_blank" rel="noreferrer">Manual de TypeScript</a> (El mejor lugar para empezar).</li></ul></li><li><strong>Prisma (ORM):</strong><ul><li><a href="https://www.prisma.io/docs" target="_blank" rel="noreferrer">Documentación de Prisma</a> (Documentación de clase mundial).</li></ul></li><li><strong>Conceptos de Arquitectura:</strong><ul><li><a href="https://blog.cleancoder.com/uncle-bob/2012/08/13/the-clean-architecture.html" target="_blank" rel="noreferrer">Arquitectura Limpia por Robert C. Martin</a></li><li><a href="https://martinfowler.com/articles/injection.html" target="_blank" rel="noreferrer">Inyección de Dependencias por Martin Fowler</a></li></ul></li></ul><h3 id="_4-base-de-conocimiento-interna" tabindex="-1">4. Base de Conocimiento Interna <a class="header-anchor" href="#_4-base-de-conocimiento-interna" aria-label="Permalink to &quot;4. Base de Conocimiento Interna&quot;">​</a></h3><ul><li><strong>Wiki de Notion de AgroBridge:</strong> <code>[Enlace a la Página de Notion/Confluence de la Empresa]</code></li><li><strong>Diagramas de Arquitectura Global:</strong> <code>[Enlace al Tablero de Miro/Lucidchart de la Empresa]</code></li></ul>',24)])])}const h=r(t,[["render",i]]);export{p as __pageData,h as default};
